                words.add(prefix)
        else:
            if is_prefix(word, prefix):
                words.add(prefix)
            trie[prefix] = {}
            words.add(prefix)
            insert(word, prefix, trie[prefix], words)
    for word in words:
        insert(word, word, trie, words)
    # we choose the lexicographically smallest word
    def lex_smallest(words):
        smallest = ''
        for word in words:
            if word < smallest:
                smallest = word
        return smallest
    return lex_smallest(words)

