                if j > 0:
                    graph[(i, j)].append((i, j - 1))
                if j < n - 1:
                    graph[(i, j)].append((i, j + 1))

    # Perform BFS
    queue = [(1, 1)]
    visited = set()
    total_distance = 0
    while queue:
        vertex = queue.pop(0)
        if vertex not in visited:
            visited.add(vertex)
