                return total_distance
            # Otherwise, add all adjacent tiles to queue
            for adj in graph[vertex]:
                if adj not in visited:
                    queue.append(adj)
            # Add distance between vertex and adjacent tile
            for adj in graph[vertex]:
                if adj in visited:
                    total_distance += abs(vertex[0] - adj[0]) + abs(vertex[1] - adj[1])
    return -1

