    min_key = min(noted)
    if max_key in major_seq and min_key in major_seq:
        return 'A major'
    elif max_key in major_seq and min_key in minor_seq:
        return 'B major'
    elif max_key in minor_seq and min_key in major_seq:
        return 'F major'
    elif max_key in minor_seq and min_key in minor_seq:
        return 'E minor'

    # minor
    max_key = max(noted)
    min_key = min(noted)
    if max_key in minor_seq and min_key in major_seq:
        return 'F minor'
    elif max_key in minor_seq and min_key in minor_seq:
        return 'E minor'
