    row_len = len(land)
    col_len = len(land[0])
    coffee_pos = set()
    coffee_map = []
    for row in range(row_len):
        for col in range(col_len):
            if land[row][col] == '.':
                coffee_map.append(False)
            else:
                coffee_map.append(True)
                coffee_pos.add((row, col))

    def find_neighbors(pos: tuple[int, int]) -> set[tuple[int, int]]:
        row, col = pos
        neighbors = set()
        if row - 1 >= 0:
            neighbors.add((row - 1, col))
        if row + 1 < row_len:
            neighbors.add((row + 1, col))
        if col - 1 >= 0:
            neighbors.add((row, col - 1))
        if col + 1 < col_len:
            neighbors.add((row, col + 1))
        return neighbors

    def check_constraints(pos: tuple[int, int]) -> bool:
        row, col = pos
        if not coffee_map[col]:
            return False
        if coffee_map[row] and coffee_map[col]:
            return False
        neighbors = find_neighbors(pos)
        for neighbor in neighbors:
            if coffee_map[neighbor[1]]:
                return False
        return True

    def dfs(visited: list[bool], path: list[tuple[int, int]], coffee_pos: set[tuple[int, int]],
            coffee_map: list[bool]) -> bool:
        if len(coffee_pos) == 0:
            return True
        if len(path) == 0:
            return False
        row, col = path.pop()
        for pos in find_neighbors((row, col)):
            if pos not in visited and check_constraints(pos):
                if dfs(visited + [pos], path, coffee_pos, coffee_map):
                    return True
        return False

    output = []
    for row in range(row_len):
        line = []
        for col in range(col_len):
            if (row, col) in coffee_pos:
                line.append('E')
            else:
                line.append(land[row][col])
        output.append(''.join(line))
    return '\n'.join(output)

